import mealsImage from '../../assets/meals.jpg' //format to use images in react -> see img tag
import classes from '.Header.module.css'
const Header =()=>{
return(<React.Fragment> 
<header className={classes.header}>
    <h1>MS Cafe</h1>
    <button>Cart</button>
</header >
<div className={classes['main-img']}>
    <img src={mealsImage} alt="food-img"></img>
</div>
</React.Fragment>)
}
export default Header;

//for one root element we use react.fragment.
//jb class name mae '-' ho to usko [eske andar likhte check img div for info]
